import React from "react";

export default function Posts(props){
  const post = props.post;
  return(
    <div>
      <ul  className='posts' key={post.id}>
        <hr></hr>
        <li >{post.title} </li>
        <hr></hr>
        <li> {post.body}</li>  
        <hr></hr>
      </ul>
    </div>
  )
}
